import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/Event.css'; // Custom styles for the Event page

export default function Event() {
  const [events, setEvents] = useState([]);
  const [newEvent, setNewEvent] = useState({
    name: '',
    date: '',
    location: '',
    description: '',
  });
  const [editingEventId, setEditingEventId] = useState(null); // Track which event is being edited

  // Fetch all events on component mount
  useEffect(() => {
    fetchEvents();
  }, []);

  const fetchEvents = async () => {
    try {
      const response = await axios.get('/getEvents');
      setEvents(response.data);
    } catch (error) {
      console.error('Error fetching events:', error);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewEvent({ ...newEvent, [name]: value });
  };

  const addOrUpdateEvent = async (e) => {
    e.preventDefault();

    if (editingEventId) {
      // Update event
      try {
        await axios.put(`/updateEvent`, { id: editingEventId, ...newEvent });
        fetchEvents();
        setEditingEventId(null);
        setNewEvent({ name: '', date: '', location: '', description: '' });
      } catch (error) {
        console.error('Error updating event:', error);
      }
    } else {
      // Add new event
      try {
        await axios.post('/postEvent', newEvent);
        fetchEvents();
        setNewEvent({ name: '', date: '', location: '', description: '' });
      } catch (error) {
        console.error('Error adding event:', error);
      }
    }
  };

  const deleteEvent = async (id) => {
    try {
      await axios.delete(`/deleteEvent`, { data: { id } });
      fetchEvents();
    } catch (error) {
      console.error('Error deleting event:', error);
    }
  };

  const startEditing = (event) => {
    setEditingEventId(event.id);
    setNewEvent({
      name: event.name,
      date: event.date,
      location: event.location,
      description: event.description,
    });
  };

  const cancelEditing = () => {
    setEditingEventId(null);
    setNewEvent({ name: '', date: '', location: '', description: '' });
  };

  return (
    <div className="event-page">
      <h1>Event Management</h1>

      <form className="event-form" onSubmit={addOrUpdateEvent}>
        <input
          type="text"
          name="name"
          placeholder="Event Name"
          value={newEvent.name}
          onChange={handleInputChange}
          required
        />
        <input
          type="date"
          name="date"
          value={newEvent.date}
          onChange={handleInputChange}
          required
        />
        <input
          type="text"
          name="location"
          placeholder="Event Location"
          value={newEvent.location}
          onChange={handleInputChange}
          required
        />
        <textarea
          name="description"
          placeholder="Event Description"
          value={newEvent.description}
          onChange={handleInputChange}
          required
        />
        <button type="submit">{editingEventId ? 'Update Event' : 'Add Event'}</button>
        {editingEventId && (
          <button type="button" className="cancel-button" onClick={cancelEditing}>
            Cancel
          </button>
        )}
      </form>

      <div className="event-list">
        {events.map((event) => (
          <div className="event-card" key={event.id}>
            <h2>{event.name}</h2>
            <p>
              <strong>Date:</strong> {event.date}
            </p>
            <p>
              <strong>Location:</strong> {event.location}
            </p>
            <p>
              <strong>Description:</strong> {event.description}
            </p>
            <div className="event-actions">
              <button className="edit-button" onClick={() => startEditing(event)}>
                Edit
              </button>
              <button className="delete-button" onClick={() => deleteEvent(event.id)}>
                Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
